import React, { useEffect } from 'react'
import axios from 'axios'
function EmployeeAccount() {

  useEffect(()=>{
  axios.get('http://localhost:8000/auth',{withCredentials:true})
  },[])
  return (
    <div>
      <h1>This is Employee Account</h1>
    </div>
  )
}

export default EmployeeAccount
